import React, { useEffect, useState } from "react";
import "./App.css";
import ReactPlayer from "react-player";

function App() {

  const etUses = [
    "Product Development", 
    "Customer Service", 
    "Systems Improvement", 
    "Better Marketing",
    "Almost anything"
  ]

  const [seconds, setSeconds] = useState(0);

  useEffect(() => {
    const interval = setInterval(() => {
      setSeconds(second => (second === 9 ? 0 : second + 1));
    }, 5000);

    return () => clearInterval(interval);
  }, []);

  return (
    <div id="App">
      <div id="TopSection">
        <h1 id="CompanyName">Company</h1>
        <h2 id="CompanyMatra">E x T = <span id="EtUse">{etUses[seconds]}</span></h2>
     </div>
     <div id="MiddleSection">
       <div id="VideoContainer">
        <ReactPlayer 
          url="https://vimeo.com/514419233"
          controls="true"
          playsinline="true"
        />
      </div>
     </div>
     <div id="BottomSection">
        <h3 id="CompanyType">Company LLC</h3>
        <h3 id="CompanyEmail">hi@company.com</h3>
     </div>
    </div>
  );
}

export default App;
